import React, { Fragment } from 'react';
import EquipementGare from './EquipementGare'

class Gare extends React.Component {
    render() {
        return (
            <ul>
                {
                    this.props.data.map((item) =>
                        <EquipementGare key={item.id} data={item.data()} />
                    )
                }
            </ul>

        )

    }
}
export default Gare
